import { Room, RoomType } from "../models/room";
import { Message, MessageType } from "../models/message";
import { User, UserType } from "../models/user";

const userMessages = 5;

export const messages = async (): Promise<void> => {
  const users: UserType[] = await User.all();
  const room: RoomType | null = (await Room.all())[0];
  const messages: MessageType[] = [];

  if (!room || !room._id || !users || users.length === 0) return;

  for (const user of users) {
    if (!user || !user._id) continue;
    if ((await User.messages(user._id))?.length !== 0) continue;

    messages.push({
      room: room._id,
      content: `${user.nickname} joined the room (#${room._id}).`,
      from_server: true,
    });

    for (let i = 1; i <= userMessages; i++) {
      messages.push({
        room: room._id,
        user: user._id,
        content: `Message ${i} from ${user.nickname} in ${room.name} room.`,
        is_edited: Math.random() > 0.5,
      });
    }

    messages.push({
      room: room._id,
      user: user._id,
      content:
        "",
      is_vocal: true,
    });

    messages.push({
      room: room._id,
      user: user._id,
      content:
        "",
      is_image: true,
      is_edited: Math.random() > 0.8,
    });
  }

  if (messages.length === 0) return;

  await Message.bulkCreate(messages);
};
